sys_variable_value.value:
(function execute(inputs, outputs) {
  var user_account;
  var user_accounts = JSON.parse(inputs.response);
    if (inputs.status == '200') {
        outputs.status = "Success";
        user_accounts.map(function (account){
          user_account = account.accountId;
          });
     // throw new Error(" account_id ==> "+ response.accountId + " ==> ");
        outputs.account_id = user_account;
      gs.info(" User== > " + user_account);
    } else {
        outputs.error_message = inputs.error_message;
        outputs.status = "Error";
    }
})(inputs, outputs);

